import React from "react";

import {
    BrowserRouter as Router,
    Switch,
    Route,
    NavLink
  } from "react-router-dom";

function GalleryMenu(){

    return (
        <div className="gallery-menu-container">

            <Router>
                <div className="gallery-menu-flex-box">

                    <div className="gallery-menu-item">
                        <NavLink exact to="/galeria" activeClassName="active-link">Viajes</NavLink>
                    </div>
                    <div className="gallery-menu-item">
                        <NavLink exact to="/galeria/bienes_raices" activeClassName="active-link">Bienes Raices</NavLink>
                    </div>
                    <div className="gallery-menu-item">
                        <NavLink exact to="/galeria/comerciales" activeClassName="active-link">Comerciales</NavLink>
                    </div>
                    <div className="gallery-menu-item">
                        <NavLink exact to="/galeria/cinematografia" activeClassName="active-link">Cinematografia</NavLink>
                    </div>

                    <div className="gallery-menu-item">
                        <NavLink exact to="/galeria/terrenos" activeClassName="active-link">Terrenos</NavLink>
                    </div>

                </div>

                <Switch>
                    <Route exact path="/galeria">
                        <GaleriaBienesRaices />
                    </Route>
                    <Route path="/galeria/bienes_raices">
                        <GaleriaBienesRaices />
                    </Route>
                    <Route path="/galeria/comerciales">
                        <GaleriaComerciales />
                    </Route>
                    <Route path="/galeria/cinematografia">
                        <GaleriaCinematografia />
                    </Route>
                    <Route path="/galeria/terrenos">
                        <GaleriaTerrenos />
                    </Route>
                </Switch>

            </Router>
        </div>
    );
}

  function GaleriaBienesRaices() {
    return (

            <p>serviciosBR</p>

    );     
  }

  function GaleriaComerciales() {
    return (
        <p>serviciosComerciales</p>


    );     
  }

  function GaleriaCinematografia() {
    return (
        <p>serviciosCinematografia</p>


    );     
  }

  function GaleriaTerrenos() {
    return (
        <p>serviciosTerrenos</p>


    );     
  }



export default GalleryMenu
